func main() {
	// a := ""
	a := "decdadccbaabtccdadced"
	res := validPalindrome(a)
	fmt.Println(res)
}

func validPalindrome(s string) bool {
	for i := 0; i < len(s)/2; i++ {
		if s[i] != s[len(s)-1-i] {
			return (isPalindrome(s, i+1, len(s)-1-i) || isPalindrome(s, i, len(s)-1-i-1))
		}
	}
	return true
}

func isPalindrome(s string, i int, j int) bool {
	for k := i; k <= i+(j-i)/2; k++ {
		if s[k] != s[j-k+i] {
			return false
		}
	}
	return true
}
